style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("golang.org") {

.container, #mainframe
{
background: #111111 !important;
}
pre, #topbar, .input, .code, .output, #start
{
background: #000000 !important;
}
.inactive, .run, .share, .tour, .read a
{
background: #375EAB !important;
}
#tmp_0, #tmp_1, #tmp_2, #tmp_3, #tmp_4, #tmp_5, #tmp_6,
#tmp_7, #tmp_8, #tmp_9, #tmp_10, #tmp_11, #tmp_12, #tmp_13,
#tmp_14, #tmp_15, #tmp_16, #tmp_17, #tmp_18, #tmp_19, #tmp_20, 
.container h2
{
background: #111111 !important;
border-bottom: 1px #FFFFFF solid!important;
}
pre, .input, .output, #start
{
border: 1px #FFFFFF solid!important;
}
a, pre, p, li, h1, h2, h3, h4, h5,
.rootHeading, .code, .container, .when
{
color: #FFFFFF !important;
}
}
